import React from 'react';
import Avatar from '@material-ui/core/Avatar';
import AvatarGroup from '@material-ui/lab/AvatarGroup';
import Grid from '@material-ui/core/Grid';
import { makeStyles } from '@material-ui/core/styles';
import Simeon from '../site-images/simeon.jpg';
import Meghan from '../site-images/meghan.jpg';
import Dat from '../site-images/dat.jpg';
import Jessica from '../site-images/jessica.jpg';
import Marcoleno from '../site-images/marcoleno.jpg';

const useStyles = makeStyles((theme) => ({
    root: {
        textAlign: 'center',
        padding: theme.spacing(2),
    },
    avatar: {
        height: 200,
        width: 200,
    },
}));

const avatars = [
    Simeon,
    Meghan,
    Dat,
    Jessica,
    Marcoleno,
];

export default function AvatarExample() {
    const classes = useStyles();

    return (
        <div 
            className={classes.root} 
        >
            <Grid 
                container 
                xl 
                spacing={2}
            >
                <AvatarGroup 
                    max={3}
                >
                    {avatars.map((avatar, index) => {
                        return (
                            <Grid 
                                key={index.toString()}
                                item 
                                xs={4} 
                            >
                                <Avatar 
                                    alt='Excite user'
                                    src={avatar}
                                />
                            </Grid>
                        );
                    })}
                </AvatarGroup>
            </Grid>
        </div>
    );
}
